Продам игры из коллекции: 
- Runedound 3-ей редакции со всеми вышедшими дополнениями на русском языке (Нерушимые узы, В паутине, Позолоченный клинок, Падение темной звезды, Ярость гор) одним лотом - 8300 руб; 
- О мышах и тайнах со всеми вышедшими дополнениями на русском языке (Угасшее сердце, Сказки нижнелесья) одним лотом - 7500 руб; 
- О хвостах и перьях на русском языке - 3000 руб; 
- Кольт-экспресс на русском языке (хотя игра языконезависимая в целом) - 1500 руб; 
- Битва за рокуган на русском языке - 1500 руб. 
